import './App.css';
import React from "react";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";

import HomePage from "../pages/home.js";


function alert() {
    window.alert("Hi there you clicked this button")
}

function App() {
  return (
      <Router>
          <Switch>
              <Route path="">
                  <HomePage/>
              </Route>
          </Switch>
      </Router>
  );
}

export default App;
